import React from "react";
import "./App.css";

function App() {
  return (
    <div>
      <h1 class="ui header"> REST API Calculations </h1>

      <form class="ui form">
        <div class="field">
          <label>First Number</label>
          <input type="number" name="first-number" placeholder="First Number" />
        </div>
        <div class="field">
          <label>Second Number</label>
          <input
            type="number"
            name="second-number"
            placeholder="Second Number"
          />
        </div>
      </form>
    </div>
  );
}

export default App;
